import {
  Navigate,
  Outlet
} from 'react-router-dom'
import { useContext } from 'react'

const PrivateRoute = () => {

  let {user} = useContext()

  const auth = true

  return auth ? < Outlet / > : < Navigate to = "login/" />
}

export default PrivateRoute;
